Update the value of an array by index in document in MongoDB with node.js<p>I am creating a e-commerce website in react and I am adding a multiple address functionality, but I am new to MongoDB and I have no Idea how do I update a value of an array by it's index, I am taking the details of the address by destructuring the <code>req.body</code> and taking the <code>addressId</code> which is the index of the <code>address</code> array which the user wants to update, I want to update the array <code>address</code> at the position of <code>addressId</code>(0, 1, 2, 3...).</p>
<p>or if I can update the array in anyway by it's index then it would also work for me
please help me out.</p>
<p>my current code.</p>
<pre><code>exports.updateAddress = async (req, res, next) =&gt; {
  try {
    const { userId, addressId, firstname, lastname, company, phone, address1, address2, city, zipcode, state, defaultAdd } = req.body;
    const result = await User.updateOne({ _id: userId }, {
      address: { // this address needs to be updated by the index.
        firstname: firstname,
        lastname: lastname,
        company: company,
        phone: phone,
        address1: address1,
        address2: address2,
        city: city,
        zipcode: zipcode,
        state: state,
        defaultAdd: defaultAdd
      }
    })
    console.log(result)
    res.status(200).json({
      data: true
    })
  } catch (error) {
    next(error)
  }
}
</code></pre>
<p>my user schema</p>
<pre><code>const mongoose = require('mongoose');
const Schema = mongoose.Schema;

const UserSchema = new Schema({
  firstname: {
    type: String,
    required: true
  },
  lastname: {
    type: String,
    required: true
  },
  email: {
    type: String,
    required: true
  },
  password: {
    type: String,
    requried: true
  },
  role: {
    type: String,
    default: 'basic',
    enum: [&quot;basic&quot;, &quot;supervisor&quot;, &quot;admin&quot;]
  },
  accesstoken: {
    type: String
  },
  address: [ // this is the address array schema 
    {
      addressId: {
        type: Number,
        required: true
      },
      firstname: {
        type: String,
        required: true
      },
      lastname: {
        type: String,
        required: true
      },
      company: {
        type: String,
      },
      phone: {
        type: Number,
        required: true
      },
      address1: {
        type: String,
        required: true
      },
      address2: {
        type: String
      },
      city: {
        type: String,
        required: true
      },
      zipcode: {
        type: Number,
        required: true
      },
      state: {
        type: String,
        required: true
      },
      defaultAdd: {
        type: String
      }
    }
  ]
});

module.exports = mongoose.model('users', UserSchema);
</code></pre>

