MongoDB query by datetime field 1h interval<p>I've been trying to extract one record each 1 hour from a collection with 1 record each 10 seconds on the <strong>datetime</strong> (Date). The document is like this:</p>
<pre><code>datetime: 2021-11-26T15:08:20.000+00:00
owner_id: &quot;INTERNAL&quot;
motor_id: 24
</code></pre>
<p>The <strong>datetime</strong> document field is Date() type.</p>
<p>On this collection I've <strong>1 record each 10 seconds on datetime field</strong> (several days), but I would like to extract just one record each <strong>1 hour datetime interval</strong>. How could I archive this?</p>
<p>Thanks in advance for any tip, help or direction to the right documentation.</p>
<p>I was trying to follow this: <a href="https://mongoing.com/docs/reference/operator/aggregation/filter.html" rel="nofollow noreferrer">https://mongoing.com/docs/reference/operator/aggregation/filter.html</a> with no success. Not sure how to increment the hour.</p>
<p>EDIT: Some more information about the collection:</p>
<p>collection1 with 26.303 records like this:</p>
<pre><code>{
  &quot;_id&quot;: {
    &quot;$oid&quot;: &quot;644b34a3756b9c1dc169e20d&quot;
  },
  &quot;datetime&quot;: {
    &quot;$date&quot;: {
      &quot;$numberLong&quot;: &quot;1637939300000&quot;
    }
  },
  &quot;customer_id&quot;: &quot;INTERNAL&quot;,
  &quot;owner_id&quot;: &quot;INTERNAL&quot;,
  &quot;GMHP&quot;: -0.54,
  &quot;AMHP&quot;: 198.19,
  &quot;OMHP&quot;: 428.883544921875,
  &quot;AROP&quot;: 148.57066345214844,
  &quot;OROP&quot;: 102.5451889038086
}
</code></pre>
<p>Each document has a 10 seconds interval stored in datetime field. I've plans to change those documents to time-series in the future.
My goal is to select the documents on each hour, e.g:</p>
<p>1st document datetime: 2021-11-26T<strong>15:08:20</strong>.000+00:00
2nd document datetime: 2021-11-26T<strong>15:09:20</strong>.000+00:00
and so on...</p>
<p>I could safely ignore all fields between T15:<strong>08:30</strong> to T15:<strong>09:10</strong>.</p>

