<p>An $or won't work because the number of lookup items is not fixed, unless it's the case that the only way to do this is dynamically create the $or query...</p>
<p>e.g.</p>
<pre><code>db.tshirts.insertMany([
    {_id:0, code: &quot;123&quot;, label: &quot;Yellow T-Shirt&quot;, style: [{ size: &quot;SM&quot;, fabric: &quot;cotton&quot;},{ size: &quot;MD&quot;, fabric: &quot;bamboo&quot;}]},
