MongoDB - Fetch document with the latest Timestamp from multiple levels of nested documents<p>My requirement is to fetch the last updated document from the multiple levels of embedded list of documents. Is there any query or aggregation I can write to get only the document that is last updated from this list of documents?</p>
<p><strong>Document Structure</strong></p>
<pre><code>{
  _id: &quot;123&quot;,
  updatedAt: ISODate(&quot;2023-03-02T14:04:37.925+00:00&quot;),
  embedded: [
    {
      _id: &quot;456&quot;,
      updatedAt: ISODate(&quot;2023-04-02T14:04:37.925+00:00&quot;),
      nested:[
           {
             _id: &quot;147&quot;,
             updatedAt: ISODate(&quot;2023-04-15T14:04:37.925+00:00&quot;)
           },
           {
             _id: &quot;258&quot;,
             updatedAt: ISODate(&quot;2023-03-11T14:04:37.925+00:00&quot;)
           }
        ]
    },
    {
      _id: &quot;789&quot;,
      updatedAt: ISODate(&quot;2023-04-10T14:04:37.925+00:00&quot;)
    }
  ]
} 
</code></pre>
<p>I want to fetch the document with _id: &quot;147&quot; as it is the last updated document in the embedded list. I want to do this for all the root documents which have embedded key. In simple terms I want to sort on all the timestamps at any level and give out the latest updated document. I don't need to know at which level I found out the latest updated document, but the timestamp of that document. Have to keep in mind that the 1st level nested document might not have another level of embedded list of documents, Yet it needs to be compared to other documents in the list and their timestamps.</p>
<p><strong>Expected Result</strong></p>
<pre><code>{
   _id: &quot;123&quot;,
   updatedAt: ISODate(&quot;2023-03-02T14:04:37.925+00:00&quot;),
   embedded: [
     {
        _id: &quot;147&quot;,
        updatedAt: ISODate(&quot;2023-04-15T14:04:37.925+00:00&quot;)
     },
   ]
}
</code></pre>

